export const User = () => {
  const [users, setUsers] = useState([]);
  const fetchData = () => {
    axios
      .get("https://jsonplaceholder.typicode.com/users")
      .then((response: any) => {
        setUsers(response.data);
        console.log(users);
      })
      .catch((error: any) => console.log(error));
  };
  return (
    <div>
      <p>USER PAGE</p>
      {/* <p>{users}</p> */}
    </div>
  );
};
